var app=angular.module("ngOutpost",[]);app.constant("ngOutpostApp",{VERSION:"0.1.0",API_KEY:"YOUR API KEY",APP_NAME:"YOUR APP NAME"}),app.factory("NgOutpostFactory","$http","ngOutpostApp",function(a){var b={};return b.getMessages=function(b){return a.post("http://outpost.mulleravenue.com/api/get/message",{api_key:ngOutpostApp.API_KEY})},b.createMessage=function(b){return a.post("http://outpost.mulleravenue.com/api/create/message",{api_key:ngOutpostApp.API_KEY,source:b.source,app_name:ngOutpostApp.APP_NAME,from_name:b.from_name,from_email:b.from_email,subject:b.subject,body:b.body})},b.deleteMessage=function(b){return a.post("http://outpost.mulleravenue.com/api/delete/message",{api_key:ngOutpostApp.API_KEY,mid:b.mid})},b});